import React from "react";
import Notes from "../notes";

function createNote(notes) {
  return <Note key={notes.key} title={notes.title} content={notes.content} />;
}

function Note(props) {
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
    </div>
  );
}

export default note;
